<!DOCTYPE html>
<html>
    <head>
    </head>
    <body>
        <!--An unvisited link is underlined and blue
            A visited link is underlined and purple
            An active link is underlined and red
            Opens the document in the same window/tab as it was clicked-->
        <a href="https://github.com/YiTing1110/wp110b/wiki">Default.</a>
        
        <a href="https://github.com/YiTing1110/wp110b/wiki" target="_self">Opens the document in the same window/tab as it was clicked</a>
        <a href="https://github.com/YiTing1110/wp110b/wiki" target="_blank">Opens the document in a new window or tab</a>
        <a href="https://github.com/YiTing1110/wp110b/wiki" target="_parent">Opens the document in the parent frame</a>
        <a href="https://github.com/YiTing1110/wp110b/wiki" target="_top">Opens the document in the full body of the window</a>
    </body>
</html>
